var text = ["","In this module, we'll see what happens to K and (&Delta;)G when we double, reverse, or combine reactions. We will use this general reaction and indicate the values for this original reaction with the 'orig' subscript on the free energy and equilibrium constant like this.","Here are the equations for K for this reaction. The first is the Law of Mass Action, and the second is derived from the Gibbs Free Energy equation, which was explained in Module 6.","What happens when we double the reaction? That is, what if each stoichiometric coefficient in the chemical equation doubles? Note that the free energy doubles, since the amount of substances being converted by the reaction doubles. In the original reaction, 1 mol of A reacts with 2 mols of B to produce 1 mol of C. In the doubled reaction, 2 mols of A react with 4 mols of B to produce 2 mols of C.","We can write the law of mass action (K = Q at equilibrium) for this doubled reaction as shown here.","In comparison with K of the original reaction, we see that K of the doubled reaction is the square of the original K.","K for the doubled reaction must then be the square of the original K.","The changes in the free energy and K are consistent, since doubling the free energy in the exponential is equivalent to squaring the exponential.","Now, letâ€™s move on. What happens if we reverse how the original reaction is written? The free energy changes sign: if the reaction is uphill in free energy in the forward direction, it must be downhill in the reverse reaction (and vice versa).","Comparing the law of mass action (K = Q at equilibrium) for the reverse reaction with that of the original reaction, we see that K of the reverse reaction is the inverse of the original K (raising an expression to the -1 power is equivalent to taking the inverse of the expression).","K for the reverse reaction is then the inverse of the original K.","The changes in the free energy and K are consistent, since changing the sign of the free energy in the exponential is equivalent to raising K to the power of -1.","Finally, what happens when we add two reactions to obtain a third reaction? Note that the chemical species C cancels when we add the first two reactions together to get the third reaction.","Hess's law tells us that the free energies of a multi-step reaction add together for a summed reaction.","Now, we'll show that the equilibrium constants multiply together for the summed reaction.","The laws of mass action (K = Q at equilibrium) for each of the original reactions and the summed reaction are shown here.","Comparison of the above laws of mass action shows that K of the summed reaction is the product of the K's for the original reaction.","Next, we show that the addition of free energies is consistent with multiplying the equilibrium constants. We first substitute in the relation between K and free energy for each of the reactions.","The product of exponentials on the left hand side can be combined into a single exponential by summing the exponents.","This confirms that taking the product of the equilibrium constants for reaction 1 and reaction 2 is consistent with summing the free energies of the reactions."];

